function isMobile(){try{return document.createEvent("TouchEvent"),!0}catch(i){return!1}}var mfobj={settings:{color:"white",width:16,height:12},parse:function(i,t={}){if(1==isMobile()){var o=mfobj.settings;return t!=={}&&(t.color&&(o.color=t.color),t.width&&(o.width=t.width),t.height&&(o.color=t.height)),"black"==o.color?i.split("￼").join(`<img src="images/obj_black.png" width="${o.width}" height="${mfobj.settings.height}" class="mobile-obj obj-black">`):i.split("￼").join(`<img src="images/obj_white.png" width="${o.width}" height="${o.height}" class="mobile-obj obj-white">`)}return i}};
